const fs = require('fs');
const csv = require('csv-parser');

const customers = [];

fs.createReadStream('../assets/sample_customers.csv')
  .pipe(csv())
  .on('data', (row) => {
    const customer = {
      id: parseInt(row['Index']),
      name: row['Name'],
      address: '',
      phoneNumber: '',
    };

    customers.push(customer);
  })
  .on('end', () => {
    console.log(customers);
  });
